import React from "react";

const Home = () => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-900 text-center px-4">
      <h1 className="text-4xl md:text-5xl font-extrabold text-white mb-4">
        Welcome to <span className="text-indigo-400">AI Code Review App</span>
      </h1>
      <p className="text-lg text-gray-300 mb-8">
        Click below to continue with GitHub
      </p>
      <a href="http://localhost:5000/auth/github">
        <button className="px-6 py-3 text-lg font-semibold text-white bg-indigo-600 rounded-lg shadow-lg hover:bg-indigo-700 transition duration-300">
          Login with GitHub
        </button>
      </a>
    </div>
  );
};

export default Home;
